import csv         with open ('/Users/marinaduarte/Documents/python-challenge/PyPoll/Resources/election_data.csv', 'r') as csvFile:    csvreader = csv.reader(csvFile)    header = next(csvreader)        data = []    total_votes = 0    candidatesResults = {}        for row in csvreader:        total_votes = total_votes + 1        candidate = row[2]        #Create dictionary with votes by candidate        if candidate not in data:            data.append(candidate)            candidatesResults[row[2]] = 0        candidatesResults[row[2]] = candidatesResults[row[2]] + 1                #print(total_votes)    #print(data)    #print(candidatesResults)       #print(candidatesResults["Khan"])      #create dictionary with percentage by candidate    p_dict = {}    for x in candidatesResults:          p_dict[x] = int(candidatesResults[x]/total_votes *100)            #print(p_dict)               #Print Results    print("Election Results")    print("--------------------------")    print("Total votes: ",total_votes)    print("--------------------------")    print("Khan: ", p_dict["Khan"], "%","(", candidatesResults["Khan"], ")")    print("Correy: ",p_dict["Correy"],"%","(", candidatesResults["Correy"],")")    print("Li: ",p_dict["Li"],"%","(", candidatesResults["Li"],")")    print("O'Tooley: ",p_dict["O'Tooley"],"%","(", candidatesResults["O'Tooley"],")")    #Get the winner    winner = max(candidatesResults,key=candidatesResults.get)    print("Winner:",winner)    #if candidatesResult["Kahn"] > candidatesResult["Correy"] and > candidatesResult["Li"] and > candidatesResult["OTooley"]:        #print("Winner: Khan")    #elif percentage_Correy > percentage_Khan and > percentage_Li and > percentage_OTooley:        #print("Winner: Correy")    #elif percentage_Li > percentage_Correy and > percentage_Khan and > percentage_OTooley:        #print("Winner: Li")        #else print("Winner: O'Tooley")        #print txt with resultstxtfile = open('/Users/marinaduarte/Documents/python-challenge/PyPoll/results2.txt', 'w') print("Election Results", file = txtfile)print("--------------------------", file = txtfile)print("Total votes: total_votes", file = txtfile)print("--------------------------", file = txtfile)print("Khan: ", p_dict["Khan"], "%","(", candidatesResults["Khan"], ")", file = txtfile)print("Correy: ",p_dict["Correy"],"%","(", candidatesResults["Correy"],")", file = txtfile)print("Li: ",p_dict["Li"],"%","(", candidatesResults["Li"],")", file = txtfile)print("O'Tooley: ",p_dict["O'Tooley"],"%","(", candidatesResults["O'Tooley"],")", file = txtfile)print("Winner:",winner, file = txtfile)txtfile.close()